import React from "react";

export default function Paged({recipePerPage, allRecipes, Paginado}){
    const pageNumbers = []
    console.log('numero de pagina: ', pageNumbers)
    console.log('recipePerPage',recipePerPage)
    console.log('allRecipes',allRecipes)
    console.log('total:' , Math.ceil(allRecipes/recipePerPage))

    for(let i=0 ; i<= Math.ceil(allRecipes/recipePerPage); i++){
        pageNumbers.push(i)
    }
    console.log(pageNumbers)
    return(
        <nav>
            <ul>
                {
                    pageNumbers &&
                    pageNumbers.map(number=>{
                        <li>
                        <a onClick={()=>Paginado(number)}>{number}</a>
                        </li>
                    })
                }
            </ul>
        </nav>
    )
}
